<p>线性表的链式存储又称单链表。对每个结点，除存放自身数据外，还需要存放一个指向其后继的指针。
通常用头指针来标识一个单链表，头指针为null时表示一个空表。为了操作上的方便，在单链表第一个结点之前附加一个结点，成为头结点。头结点数据域可以不存任何信息，也可以记录表长等信息。头结点的指针域指向线性表的第一个结点。</p>
